const Maping = () => {
  var arr = [
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
    { name: "bhavya", age: 21 },
  ];

  return (
    <>
      <table border={1} cellPadding={10}>
        <tr>
          <th>NO</th>
          <th>NAME</th>
          <th>AGE</th>
        </tr>
        {arr.map((e, index) => {
          return (
            <>
              <tr>
                <td>{index + 1}</td>
                <td>{e.name}</td>
                <td>{e.age}</td>
              </tr>
            </>
          );
        })}
      </table>
    </>
  );
};

export default Maping;
